import React, { Component } from "react";
import "./title.css";
class Title extends Component {
  render() {
    return (
      <React.Fragment>
        <div id="header">
          <h1>YouTube Randomizer</h1>
          <p>Created by Evan Mikesell</p>
        </div>
      </React.Fragment>
    );
  }
}
export default Title;
